function keyConfig(_keyCode, _x, _y, _status) {
  this.keycode = _keyCode;
  this.x = _x;
  this.y = _y;
  this.status = _status;
}

var keyConfigs;
var colorMap;
var mouseWasPressed = false;

var imgData = "data:image/jpeg;base64,";

function setup() {
  createCanvas(720, 400);
  img = loadImage(imgData); // Load the image
  colorMap = [color(25), color(0, 255, 0), color(255, 0, 0)];
  keyConfigs = [
    new keyConfig(72, 45, 30, 0), //H
    new keyConfig(73, 36, 76, 0), //I
    new keyConfig(74, 45, 121, 0), //J
    new keyConfig(75, 36, 171, 0), //K
    new keyConfig(76, 45, 217, 0), //L
    new keyConfig(77, 36, 265, 0), //M

    new keyConfig(87, 439, 30, 0), //W
    new keyConfig(65, 447, 76, 0), //A
    new keyConfig(83, 439, 121, 0), //S
    new keyConfig(68, 447, 171, 0), //D
    new keyConfig(70, 439, 217, 0), //F
    new keyConfig(71, 447, 265, 0), //G

    new keyConfig(UP_ARROW, 159, 100, 0), //UP
    new keyConfig(DOWN_ARROW, 159, 170, 0), //DOWN
    new keyConfig(LEFT_ARROW, 124, 136, 0), //LEFT
    new keyConfig(RIGHT_ARROW, 193, 136, 0), //DOWN
    new keyConfig(32, 351, 100, 0), //SPACE
  ];
}

function draw() {
  image(img, 0, 0);
  strokeWeight(3);
  noFill();

  for (i = 0; i < keyConfigs.length; i++) { //draw circles
    config = keyConfigs[i];
    stroke(colorMap[config.status]);
    ellipse(config.x, config.y, 30, 30);
  }

  for (i = 0; i < keyConfigs.length; i++) { //draw circles
    config = keyConfigs[i];
    if (keyIsDown(config.keycode)) {
      if (config.status === 0) {
        config.status = 1;
      }
      for (j = i + 1; j < keyConfigs.length; j++) { //check if 2 keys are both pressed
        config2 = keyConfigs[j];
        if (keyIsDown(config2.keycode)) {
          config.status = 2;
          config2.status = 2;
        }
      }
    }
  }

  if (mouseIsPressed != mouseWasPressed) {
    if (mouseWasPressed) {
      for (i = 0; i < keyConfigs.length; i++) { //draw circles
        keyConfigs[i].status = 0;
      }
    }
    mouseWasPressed = mouseIsPressed;
  }

  countGreen = 0;
  countRed = 0;
  for (i = 0; i < keyConfigs.length; i++) { //draw circles
    config = keyConfigs[i];
    if (config.status == 1) countGreen++;
    if (config.status == 2) countRed++;
  }
  if (countRed > 0) {
    document.getElementById("info").innerHTML = "检测到同时按下按键，可能有短路";
  } else if (countGreen == 0) {
    document.getElementById("info").innerHTML = "就绪";
  } else if (countGreen == keyConfigs.length) {
    document.getElementById("info").innerHTML = "检测完成，保持鼠标光标在窗口内，测试Click";
  } else {
    document.getElementById("info").innerHTML = "目前正常";
  }
}